import { Link } from 'react-router-dom'
import Card from 'react-bootstrap/Card'

function CardComponent(props) {
    return (

            <Card>{props.data.map((item) => (
                <Card.Body>
                    
                    
                        {item.title}
                        <Link to={`/info/${item.title}/`}>Дивитись статтю</Link>
                    
               </Card.Body>
                ))}
            </Card>
  

    )
}

export default CardComponent
